import Toolbar from "@material-ui/core/Toolbar";
import logoTransparent from "../images/logo_transparent.png";
import Typography from "@material-ui/core/Typography";
import IconButton from "@material-ui/core/IconButton";
import Avatar from "@material-ui/core/Avatar";
import profilePhoto from "../images/profilePhoto.jpeg";
import MoreIcon from "@material-ui/icons/MoreVert";
import AppBar from "@material-ui/core/AppBar";
import React from "react";
import {makeStyles} from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    title: {
        display: 'none',
        [theme.breakpoints.up('xs')]: {
            display: 'block',
        },
    },
    sectionDesktop: {
        display: 'none',
        [theme.breakpoints.up('sm')]: {
            display: 'flex',
        },
    },
    sectionMobile: {
        display: 'flex',
        [theme.breakpoints.up('sm')]: {
            display: 'none',
        },
    },
}));

function ApplicationBar() {
    const classes = useStyles();

    return (
        <AppBar position="static">
            <Toolbar>
                <img src={logoTransparent} className="App-logo" alt="logo"/>
                <Typography className={classes.title} variant="h6" noWrap>
                    Abdullayeva
                </Typography>
                <div className={classes.grow}/>
                <div className={classes.sectionDesktop}>
                    <IconButton color="inherit">
                        <Typography className={classes.title} variant="button" noWrap>
                            About
                        </Typography>
                    </IconButton>
                    <IconButton color="inherit">
                        <Typography className={classes.title} variant="button" noWrap>
                            Projects
                        </Typography>
                    </IconButton>
                    <IconButton color="inherit">
                        <Typography className={classes.title} variant="button" noWrap>
                            Blog
                        </Typography>
                    </IconButton>
                    <IconButton
                        edge="end"
                        aria-label="account of current user"
                        aria-controls={menuId}
                        aria-haspopup="true"
                        onClick={handleProfileMenuOpen}
                        color="inherit"
                    >
                        <Avatar alt="Profile Picture" src={profilePhoto}/>
                    </IconButton>
                </div>
                <div className={classes.sectionMobile}>
                    <IconButton
                        aria-label="show more"
                        aria-controls={mobileMenuId}
                        aria-haspopup="true"
                        onClick={handleMobileMenuOpen}
                        color="inherit"
                    >
                        <MoreIcon/>
                    </IconButton>
                </div>
            </Toolbar>
        </AppBar>
    )
}

export default ApplicationBar;
